import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Header from './Header';
import Filters from './Filters';

class App extends Component {
  render() {
    return (
      <div className="App">
       <Header />
       <div className="wrapper">
         <div className="filtersLinks">

         </div>
         <Filters />
       </div>
      </div>
    );
  }
}

export default App;
